create table cloud_run_test_report (timestamp timestamp(6), build varchar(255) not null, image varchar(255), job varchar(255) not null, pipeline varchar(255) not null, project_id varchar(255), report_url varchar(255), tag varchar(255), team varchar(255) not null, url oid, primary key (build, job, pipeline, team));
create table firebase_test_report (timestamp timestamp(6), branch varchar(255), build varchar(255) not null, commit varchar(255), commit_author varchar(255), job varchar(255) not null, path varchar(255), pipeline varchar(255) not null, project_id varchar(255), report_url varchar(255), repository varchar(255), tag varchar(255), team varchar(255) not null, test_branch varchar(255), test_commit varchar(255), test_commit_author varchar(255), test_path varchar(255), test_repository varchar(255), test_tag varchar(255), url oid, primary key (build, job, pipeline, team));